import React from "react";
import { useState,useEffect } from "react";
function Twitter (){
    const [data, setData] = useState([]);
    useEffect(() => {
        fetch("data.json")
        .then(response => response.json())
        .then(jsonData => {
          setData(jsonData);
        });
    }, []);
    return (
        <div>
            {data.map(item => (
        <div key={item.id} style={{ display: "inline-block", margin: 10 }}>
          <div >
            <h3>{item.name}</h3>
            <p>{item.value}</p>
          </div>
        </div>
      ))}
        </div>
    );
}

export default Twitter;
